import React from 'react'
const footerInfor=[
    {
        title:"레이아웃 영역",
        menu1:"레이아웃 유형01",
        menu2:"레이아웃 유형02",
        menu3:"레이아웃 유형03",
        menu4:"레이아웃 유형04",
        menu5:"레이아웃 유형05",
    },{
        title:"헤더 영역",
        menu1:"메뉴 유형01"
    },
    {
        title:"메인 영역",
        menu1:"이미지 유형01",
        menu2:"동영상 유형02",
        menu3:"슬라이드 유형03",
    },{
        title:"컨텐츠 영역",
        menu1:"텍스트 유형01",
        menu2:"이미지 유형02",
        menu3:"이미지/텍스트03",
        menu4:"카드 유형04",
        menu5:"배너 유형05",
    },{
        title:"푸터 영역",
        menu1:"컨택트 유형01",
        menu2:"푸터 유형02",
    },{
        title:"사이트 영역",
        menu1:"웹표준 사이트",
        menu2:"반응형 사이트",
        menu3:"패럴랙스 사이트",
        menu4:"포트폴리오 사이트"
    }
]

function Info({title,menu1,menu2,menu3,menu4,menu5}){
    return(
        <div>
              <h3>{title}</h3>
              <ul>
                <li>
                  <a href="/">{menu1}</a>
                </li>
                <li>
                  <a href="/">{menu2}</a>
                </li>
                <li>
                  <a href="/">{menu3}</a>
                </li>
                <li>
                  <a href="/">{menu4}</a>
                </li>
                <li>
                  <a href="/">{menu5}</a>
                </li>
              </ul>
        </div>
    )
}

function Footer() {
  return (
    <footer id="footerType" className="footer__wrap section nexon gray">
        <h2 className="ir_so">푸터 영역</h2>
        <div className="footer__inner container">
          <div className="footer__menu">
            <div>
            {footerInfor.map((txt)=>(
            <Info 
            title={txt.title} 
            menu1={txt.menu1} 
            menu2={txt.menu2} 
            menu3={txt.menu3} 
            menu4={txt.menu4} 
            menu5={txt.menu5} 
            key={txt.text}
            />
        ))}
            </div>

          </div>
          <address className="footer__right">
            ©2022 webstroyboy. All rights reserved.
          </address>
        </div>
    </footer>
  )
}

export default Footer
